from tkinter import *
from tkinter.ttk import *
from tkinter.messagebox import *
from threading import Thread
import sys, os, urllib.request, urllib.error
import configtest, server, install

version = "1.0"
title = "Horse %s"%version
data = ""

root = Tk()
icon = PhotoImage(data=data)
root.title("Horse %s"%version)
root.tk.call('wm', 'iconphoto', root._w, icon)
def checkForUpdates():
    try:
        r = urllib.request.urlopen('http://horseserver.tk/version.html')
        if r.read().decode() != version:
            return True
    except urllib.error.URLError as err:
        pass
    return False

if checkForUpdates():
    root.withdraw()
    if askyesno(title, "The new version, %s, is availible. Would you like to download the new version?"):
        install.install()
        sys.exit(0)

if not configtest.test():
    root.withdraw()
    if askokcancel(title, "Your configuration is invalid.\nWould you like to overwrite the configuration and\ncontinue with default settings, or exit the program?"):
        configtest.create()
        root.deiconify()
    else:
        sys.exit(0)

CONFIGURATION = configtest.config()
os.chdir(CONFIGURATION.serve_dir)
serverOn = False
server.setup(CONFIGURATION)

class redir():
    def __init__(self):
        self.string = ''
        self.buff = 0
    def write(self, txt):
        self.string += txt 
        print(txt,end='')
    def read(self, buff):
        newbuff = min(self.buff+buff,len(self.string))
        ret = self.string[self.buff:newbuff]
        self.buff = newbuff
        return ret
    def flush(self):
        pass

serverThread = None
sys.stderr = stdout = redir()

def toggleserver():
    global serverOn
    if serverOn:
        toggleserver['state'] = DISABLED
        toggleserver['text'] = 'Stopping...'
        serverStopThread = Thread(target=server.stop, args=[toggleserver])
        serverStopThread.start()
        serverOn=False
    else:
        toggleserver['text'] = 'Stop Server'
        serverThread = Thread(target=server.run)
        serverThread.start()
        serverOn=True
        
def updateStatusThread():
    #if stdout==None: root.after(100, updateStatusThread);print(':/'); return
    l = stdout.read(256)
    if not l in ['',None]:
        statusT.insert(END,l)
    root.after(100, updateStatusThread)


ui = Frame(root)
status = Frame(root)

toggleserver = Button(ui,text='Start Server', command=toggleserver)
toggleserver.grid()
resetConfig = Button(ui,text="Reset Configuration", command=configtest.create)
resetConfig.grid()

statusT = Text(status)
statusT.pack(fill=BOTH,expand=1)

ui.pack(side=LEFT,fill=BOTH, expand=1)
status.pack(side=RIGHT,fill=BOTH,expand=1)
root.after(100, updateStatusThread)
root.mainloop()
if serverOn:
    server.stop()
